import React, { useState, useEffect } from 'react';
import { rtdb, auth } from './config';
import { ref, set, get, onValue, push, serverTimestamp } from 'firebase/database';

const FirebaseDebugger = () => {
  const [connected, setConnected] = useState(null);
  const [writeStatus, setWriteStatus] = useState(null);
  const [readStatus, setReadStatus] = useState(null);
  const [error, setError] = useState(null);
  const [testData, setTestData] = useState(null);
  const [authStatus, setAuthStatus] = useState(null);
  
  useEffect(() => {
    // Check if Firebase is initialized
    if (!rtdb) {
      setError("Firebase Realtime Database is not initialized");
      return;
    }
    
    try {
      // Monitor connection state
      const connectedRef = ref(rtdb, '.info/connected');
      const unsubscribe = onValue(connectedRef, (snap) => {
        const isConnected = snap.val() === true;
        setConnected(isConnected);
      });
      
      // Check auth state
      const authUnsubscribe = auth.onAuthStateChanged((user) => {
        setAuthStatus({
          isLoggedIn: !!user,
          userId: user ? user.uid : null,
          email: user ? user.email : null
        });
      });
      
      // Cleanup
      return () => {
        unsubscribe();
        authUnsubscribe();
      };
    } catch (err) {
      setError(`Firebase monitoring error: ${err.message}`);
    }
  }, []);
  
  const testDatabaseWrite = async () => {
    try {
      setWriteStatus("Attempting to write...");
      setError(null);
      
      const debugRef = ref(rtdb, "debug/tests");
      const newTestRef = push(debugRef);
      
      await set(newTestRef, {
        timestamp: serverTimestamp(),
        client: navigator.userAgent,
        testValue: "Firebase is working!",
        date: new Date().toISOString()
      });
      
      setWriteStatus("Write successful!");
    } catch (err) {
      setWriteStatus("Write failed");
      setError(`Write error: ${err.message}`);
    }
  };
  
  const testDatabaseRead = async () => {
    try {
      setReadStatus("Attempting to read...");
      setError(null);
      
      const debugRef = ref(rtdb, "debug/tests");
      const snapshot = await get(debugRef);
      
      if (snapshot.exists()) {
        setTestData(snapshot.val());
        setReadStatus("Read successful!");
      } else {
        setTestData(null);
        setReadStatus("No data found");
      }
    } catch (err) {
      setReadStatus("Read failed");
      setError(`Read error: ${err.message}`);
    }
  };
  
  return (
    <div style={{
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
      fontFamily: 'monospace',
      backgroundColor: '#f5f5f5',
      borderRadius: '8px'
    }}>
      <h2>Firebase Connection Debugger</h2>
      
      <div style={{ margin: '20px 0' }}>
        <h3>Connection Status</h3>
        <p>Connection: {connected === null ? 'Checking...' : connected ? '✅ Connected' : '❌ Disconnected'}</p>
        <p>Database URL: {rtdb?.app?.options?.databaseURL || 'Not configured'}</p>
      </div>
      
      <div style={{ margin: '20px 0' }}>
        <h3>Authentication Status</h3>
        <p>Status: {!authStatus ? 'Checking...' : authStatus.isLoggedIn ? '✅ Logged in' : '❌ Not logged in'}</p>
        {authStatus?.isLoggedIn && (
          <>
            <p>User ID: {authStatus.userId}</p>
            <p>Email: {authStatus.email}</p>
          </>
        )}
      </div>
      
      <div style={{ margin: '20px 0' }}>
        <button 
          onClick={testDatabaseWrite}
          style={{ padding: '8px 16px', margin: '0 10px 10px 0' }}
        >
          Test Write
        </button>
        <button 
          onClick={testDatabaseRead}
          style={{ padding: '8px 16px', margin: '0 0 10px 0' }}
        >
          Test Read
        </button>
        
        <p>Write Status: {writeStatus || 'Not tested'}</p>
        <p>Read Status: {readStatus || 'Not tested'}</p>
        
        {error && (
          <div style={{ color: 'red', margin: '10px 0' }}>
            <strong>Error:</strong> {error}
          </div>
        )}
        
        {testData && (
          <div style={{ marginTop: '20px' }}>
            <h4>Test Data:</h4>
            <pre style={{ 
              backgroundColor: '#333', 
              color: '#fff', 
              padding: '10px',
              borderRadius: '4px',
              maxHeight: '200px',
              overflow: 'auto'
            }}>
              {JSON.stringify(testData, null, 2)}
            </pre>
          </div>
        )}
      </div>
    </div>
  );
};

export default FirebaseDebugger;
